import UIKit

private var takenLogoNames = Set<String>()
private let abstract = "_Abstract"
private let iteration = 10
private let wrongLogoNames: Set<String> = ["F_44", "W_37", "T_14"]

public struct FakeLogo {
    
    let scale = UIScreen.main.scale
    
    private(set) var name: String
    private(set) var imageURL: URL?
    private(set) var backgroundColor: UIColor
    private(set) var primaryColor: UIColor
    private(set) var secondaryColor: UIColor
    private(set) var detailColor: UIColor
    
    init(_ name: String) {
        let colors = logoColors(for: name)
        self.name = name
        self.backgroundColor = colors[0]
        self.primaryColor = colors[1]
        self.secondaryColor = colors[2]
        self.detailColor = colors[3]
        self.imageURL = URL(string: UrlFor.fakeIconsFolder + "\(name)@\(Int(scale))x.png")
    }
    
    init() {
        self.name = String()
        self.backgroundColor = UIColor()
        self.primaryColor = UIColor()
        self.secondaryColor = UIColor()
        self.detailColor = UIColor()
    }
    
    
}

public func fakeLogoCollection() -> [String : FakeLogo] {
    var cases = [String : FakeLogo]()
    for (name, _) in colorsData {
        cases[name] = FakeLogo(name)
    }
    return cases
}


private func logoColors(for name: String) -> [UIColor] {
    var colors = [UIColor]()
    guard let colorsHex = colorsData[name] else { return colors }
    let comp = colorsHex.components(separatedBy: .whitespaces)
    guard comp.count == 4 else { return colors }
    let background = comp[0].convertedToUIColor()
    let primary = comp[1].convertedToUIColor()
    let secondary = comp[2].convertedToUIColor()
    let detail = comp[3].convertedToUIColor()
    colors = [background, primary, secondary, detail]
    return colors
}

private func logoColorsHex(for name: String) -> [String] {
    let colors = logoColors(for: name)
    let colorsInHex = colors.map{ $0.convertedToHEXColor() }
    return colorsInHex
}

public func randomListOfLogoNameOf(size: Int) -> [String] {
    var collection = [String]()
    let selected = listOfFakeLogoNames.shuffle().prefix(size)
    collection = Array(selected)
    return collection
}

public func updateWithLogoNames(_ collection: [FakeWord]) -> [FakeWord] {
    var result = [FakeWord]()
    for fakeWord in collection {
        var fake = fakeWord
        fake.logoName = randomLogoName(for: fake)
        let colors = logoColorsHex(for: fake.logoName)
        if colors[0] != String() {
            fake.themeColor = colors[0]
        }
        result.append(fake)
    }
    return result
}



private func randomLogoName(for fakeWord: FakeWord) -> String {
    let firstL = fakeWord.title.prefix(1).uppercased()
    guard let size = fakeLogoSpace[firstL] else { return abstract + "_1" }
    guard let sizeAbs = fakeLogoSpace[abstract] else { return abstract + "_1" }
    var numbIteration = 0
    while numbIteration <= iteration {
        numbIteration += 1
        var name = String()
        
        if Bool.random() {
            let rndInt = Int.random(in: 1...size)
            name = firstL + "_\(rndInt)"
            guard !takenLogoNames.contains(name) else { continue }
            takenLogoNames.insert(name)
        } else {
            let rndInt = Int.random(in: 1...sizeAbs)
            name = abstract + "_\(rndInt)"
            guard !takenLogoNames.contains(name) else { continue }
            takenLogoNames.insert(name)
        }
        guard !wrongLogoNames.contains(name) else { continue }
        return name
    }
    
    return abstract + "_1"
}

private var listOfFakeLogoNames: [String] {
    var result = [String]()
    for (key, value) in fakeLogoSpace {
        for idx in 1...value {
            let name = key + "_\(idx)"
            result.append(name)
        }
    }
    return result
}

